import React from "react";
import * as ReactBootStrap from "react-bootstrap"
import { render } from "react-dom";
import './Nav2.css';
import { useHistory } from "react-router";
import { Link } from "react-router-dom";

function Nav(){
    const history = useHistory();
    const logout=()=>{
        history.push('/')
    }
    return(
        <>
        <div className="Navbar">
            <div className="Container">
            <Link href="#home" className="brand">Pay</Link>
            <div className="parent">
            <Link href="/" className="child">Pay to an existing user</Link>
            <Link href="#features" className="child">Send a reminder</Link>
            <Link href="#pricing" className="child">Monthly expenditure</Link>
            <Link href="register" className="child">Notifications</Link>
            </div>
            <button className="btn" onClick={logout}>Log-out</button>
            </div>
        </div>
        </>
    );
}

export default Nav;
